#include <unordered_map>
#include <vector>

using namespace std;

class Solution {
    int c = 0;
    void f(vector<int>& n, const int k, int i, int s)
    {
        if (s == k)
        {
            ++c;
        }
        if (i >= n.size()) return;

        s += n[i];
        f(n, k, i + 1, s);
    }

    int perebor(vector<int>& nums, int k)
    {
        for (int j = 0; j < nums.size(); ++j)
        {
            f(nums, k, j + 1, nums[j]);
        }

        int q = c;
        c = 0;
        return q;
    }

    int f_better(vector<int>& n, int k)
    {
        unordered_map<int, vector<int>> m;

        m[n[0]] = { 0 };
        for (int i = 1; i < n.size(); ++i)
        {
            n[i] += n[i - 1];
            m[n[i]].push_back(i);
        }

        for (int i = 0; i < n.size(); ++i)
        {
            if (n[i] == k)
            {
                ++c;
            }
            for (const int j : m[n[i] - k])
            {
                if (j < i)
                {
                    ++c;
                }
                if (j >= i) break;
            }
        }
        return c;
    }
    int f_better_optimized(vector<int>& n, int k)
    {
        unordered_map<int, vector<int>> m;

        m[n[0]] = { 0 };
        for (int i = 1; i < n.size(); ++i)
        {
            n[i] += n[i - 1];
            m[n[i]].push_back(i);
        }

        for (int i = 0; i < n.size(); ++i)
        {
            if (n[i] == k)
            {
                ++c;
            }
            auto p = lower_bound(m[n[i] - k].cbegin(), m[n[i] - k].cend(), i);
            c += distance(m[n[i] - k].cbegin(), p);
        }
        return c;
    }

    int f_best(vector<int>& n, int k)
    {
        int s = 0;
        unordered_map<int, int> m;

        for (int i = 0; i < n.size(); ++i)
        {
            s += n[i];
            if (s == k) ++c;
            auto p = m.find(s - k);
            if (p != m.end())
                c = c + p->second;
            ++m[s];
        }
        return c;
    }

public:
    int subarraySum(vector<int>& nums, int k) {
        return f_best(nums, k);
        //return perebor(nums, k);
    }
};


